import React from 'react';

function Navigation() {
  return (
    <nav style={{ padding: '10px', backgroundColor: '#f4f4f4' }}>
      <button><a href="/">Home</a></button> | 
      <button><a href="/billing">Billing</a></button> | 
      <button><a href="/stock-check">Stock Check</a></button> | 
      <button><a href="/more">More</a></button>
    </nav>
  );
}

export default Navigation;
